		<h1 style="text-align: center;">Виды греющего кабеля – какие существуют</h1>
<p><a href="shop/hot-cabel">Греющие кабели</a> широко используются для сохранения эксплуатационных характеристик кровель, трубопроводов, лестниц, тротуаров. Даже в самые сильные морозы, когда обычная теплоизоляция неэффективна, электроподогрев справится с защитой от холода. Рассмотрим виды греющего кабеля, принципы их работы, назначение и область применения.</p>
<h2>Что такое греющий кабель</h2>
<p>Это популярное и эффективное средство терморегуляции различных технологических устройств, жилых и производственных зданий, объектов городской инфраструктуры.</p>
<p> <img src="data:image/png;base64," width="800" /></p>
<p style="text-align: center;"><em>Размещение на трубопроводе</em></p>
<p> Область применения разнообразна – от систем теплого пола до поддержания плюсовой температуры в напорных и безнапорных трубопроводах.</p>
<p>Основной элемент конструкции – одно-, двух- либо многожильный провод с постоянным или непостоянным сопротивлением. Проводник окружает изолирующий слой, поверх него – оплетка из стеклонити либо металла, выполняющее роль заземления и защищающее кабель от механических повреждений, влаги и иных воздействий окружающей среды. Многожильные нагреватели считаются более надежными и практичными, нежели устройства с одной жилой.</p>
<p>Принцип работы прост: электрическая энергия, поступающая из сети, за счет сопротивления проводника преобразуется в тепловую и совершает полезную работу.</p>
<h3>Что учесть при выборе?</h3>
<p>Подбирая греющий кабель, необходимо обратить внимание на такие характеристики:</p>
<ul>
<li>назначение;</li>
<li>максимальную мощность (от нее зависит теплоотдача);</li>
<li>удельное сопротивление проводника;</li>
<li>количество проводов;</li>
<li>длину отдельных секций, возможность разрезания;</li>
<li>тип.</li>
</ul>
<p>Существует два основных типа: резистивные и саморегулирующиеся. У каждого из них имеются как свои достоинства, так и недостатки. Также следует выбирать только качественных производителей, например <a href="shop/lavita">греющие кабеля Lavita</a>.</p>
<h2>Резистивные греющие кабели</h2>
<p>Особенность резистивных устройств – высокое сопротивление и максимальная сила подающегося тока, обуславливающая активное тепловыделение.</p>
<p> <img style="display: block; margin-left: auto; margin-right: auto;" src="data:image/jpeg;base64," /></p>
<p style="text-align: center;"><em>Резистивный кабель</em></p>
<p> </p>
<p>Состоит из одной или двух жил, из-за чего называется одно- или двухжильным соответственно. Проводник окружает изолирующий слой из диэлектрика, устойчивого к воздействию высоких температур, вырабатывающихся при включении провода в сеть. Для защиты от влияния электромагнитных полей изоляция заключена в металлическую оплетку, также обеспечивающую защиту от повреждений. Вся конструкция спрятана в термостойкую герметичную оболочку, выполненную из полимерных материалов.</p>
