<p>В недорогих марках металлическая оплетка может отсутствовать.</p>
<p>Монтаж греющего кабеля с одной жилой и подключение к сети производится с двух концов. Потому он преимущественно используется в замкнутых схемах. Если по какой-то причине закольцевать кабель невозможно, то вместе с ним требуется прокладка дополнительной питающей линии.</p>
<p>В двухжильных устройствах один провод предназначен для подключения к электросети, а второй является греющим. Это позволяет расширить область применения, но повышает стоимость.</p>
<p>Авторегулировка мощности не предусмотрена. Для повышения или снижения производительности требуется установка дополнительной аппаратуры:</p>
<ul>
<li>термостата, подающего и отключающего питание проводника при изменении температуры;</li>
<li>сенсорных датчиков, посылающих терморегулятору сигнал о состоянии окружающей среды (воздуха, жидкости, грунта, технологических смесей).</li>
</ul>
<h3>Преимущества</h3>
<p>Преимущества резистивного кабеля:</p>
<ul>
<li>отсутствие потребности в пусковом токе;</li>
<li>равномерное распределение мощности на всю длину проводников;</li>
<li>срок службы – до 15 лет;</li>
<li>невысокая стоимость.</li>
</ul>
<p> <img style="display: block; margin-left: auto; margin-right: auto;" src="data:image/jpeg;base64," /></p>
<p style="text-align: center;"><em>Применение для теплого пола</em></p>
<h3>Недостатки</h3>
<p>К недостаткам применения <a href="shop/heat-plus">резистивного кабеля Heat Plus</a> и любого другого производителя относятся:</p>
<ul>
<li>постоянное потребление электроэнергии независимо от состояния окружающей среды (при отсутствии термостата);</li>
<li>одинаковое тепловыделение;</li>
<li>риск чрезмерного нагрева отдельных участков защищаемых объектов;</li>
<li>фиксированная длина – при необходимости разрезание либо наращивание невозможно;</li>
<li>при неисправности отдельного участка требуется полная замена устройства.</li>
</ul>
<h3>Применение</h3>
<p>Резистивные греющие кабели применяются для обогрева линейных объектов (подземных и наземных трубопроводов), кровель, лестниц, водостоков, напорных и безнапорных водопроводов, в том числе и для прокладки внутри труб, а также в системах теплого пола.</p>
<p>Одножильные устройства для внутренней прокладки использовать не рекомендуется: перехлесты, перегибы проводников либо слишком близкое их размещение может привести к перегреву.</p>
<h2>Саморегулирующиеся греющие кабели</h2>
<p>Теплоотдача в саморегулирующемся греющем кабеле корректируется автоматически при изменении температуры окружающей среды и на отдельных участках может отличаться.</p>
<p>Кабель состоит из медных проводов, окруженных изолирующим слоем. Вместе с проводниками установлена полупроводящая полимерная матрица с непостоянным сопротивлением, смешанная с измельченным графитом. При нагреве частички графита друг от друга отдаляются, электрический контакт между ними теряется.</p>
