<h3> Принцип действия</h3>
<p> Ток, протекающий через матрицу, падает, а вместе с ним снижается или прекращается тепловыделение на соответствующем участке. Остывание вызывает обратный процесс: полимер возвращается в исходное состояние, частицы графита сближаются и участок кабеля нагревается вновь.</p>
<p><a href="shop/fine-decer">Саморег. кабель Fine Korea</a> и других известных производителей  может быть незаменим, если подлежащие прогреву участки проходят через несколько слоев, температурные условия которых различны: на открытом воздухе, в мерзлом грунте, отапливаемом помещении.</p>
<p>Подключение к электросети производится с одной стороны. В отличие от резистивного кабеля, саморег можно перекрещивать, сращивать, в процессе монтажа делить на отрезки требуемой длины.</p>
<p>Производятся разновидности саморегулирующих кабелей во взрывозащищенном исполнении покрытия – они устанавливаются в опасных зонах. Для обогрева внутреннего сечения питьевого водопровода применяются самореги с оболочкой, не выделяющей никаких вредных веществ. Для защиты от механических воздействий применяется покрытие из луженой меди, от UV-излучений – из фторполимеров.</p>
<h3>Преимущества</h3>
<p>Преимущества саморегулирующихся кабелей:</p>
<ul>
<li>автоматическое изменения интенсивности нагрева в зависимости от температуры окружающей среды;</li>
<li>создание участков любой протяженности;</li>
<li>простота монтажа;</li>
<li>высокий КПД при низком потреблении электроэнергии;</li>
<li>отсутствие риска перегрева;</li>
<li>возможность замены отдельных участков в случае выхода их из строя;</li>
<li>срок службы – до 25 лет.</li>
</ul>
<h3>Недостатки</h3>
<p>Недостаток у саморега один – стоимость выше резистивного кабеля. Но за счет регулирования температуры использование его более выгодно в долгосрочном периоде.</p>
<h3>Область применения</h3>
<p>Саморегулирующийся кабель используется для обогрева емкостей, подземных и наземных резервуаров, цистерн, трубопроводов. </p>
<p><img src="data:image/jpeg;base64," width="800" /></p>
<p style="text-align: center;"><em>Применение для крыш</em></p>
<p> Также он широко применяется для поддержания температурного режима в различных технологических системах, подогрева водостоков, кровель, теплого пола.</p>
<p> С помощью кабельных систем можно предотвратить замерзание трубопроводов, не допустить обледенения лестниц, перил, пандусов, элементов кровли, тротуаров. Выбор в пользу<a href="shop/rezistivnyj-greyushchij-kabel"> резистивного</a> либо саморегулирующегося провода зависит от типа подлежащего обогреву объекта, температурных условий и, конечно же, имеющегося в распоряжении бюджета.</p>	</div>

	
